imageSource = "";
descSource = "ÿc5Superior Wire Fleece\nÿc0Defense: ÿc3544\nÿc0Durability: 22 of 32\nÿc1Required Strength: 111\nÿc1Required Level: 53\nÿc3+13% Enhanced Defense\nÿc3Socketed (3)$2624566070:432:3:2:0";

var itemScreenshot = {
    bgnd: [
        "",
        "",
        "",
        ""
    ],

    textColorMap: [
        "#C4C4C4",
        "#B04434",       /* RED */
        "#18FC00",       /* SET */
        "#787CE7",       /* MAGIC */
        "#948064",       /* UNIQUE */
        "#505050",       /* DARK GRAY */
        "WhiteSmoke",
        "WhiteSmoke",
        "#D08420",       /* CRAFT */
        "#D8B864"       /* RARE */
    ],

    getItemDesc: function (desc) {
        var i, out = [],
            stringColor = 0;
    
        if (!desc) {
            return "";
        }
        var lines = desc.split("\n");
        for (var line in lines) {
            out.push({ text: lines[line], color: this.textColorMap[0] })
        }
    
        // Lines are normally in reverse. Add color tags if needed and reverse order.
        for (i = out.length - 1; i >= 0; i -= 1) {
            if (out[i].text.indexOf("Sell value: ") > -1) { // Remove sell value
                out.splice(i, 1);
    
                i += 1;
            } else {
                if (out[i].text.match(/^ÿc/)) {
                    out[i].color = this.textColorMap[parseInt(out[i].text.substring(2, 3))];
                }
            }
    
            out[i].text = out[i].text.replace(/ÿc([0-9!"+<;.*])/g, "");
    
        }
        
        return out;
    },

    cleanDecription: function (description) {
        return this.getItemDesc(description.toString().split("$")[0]);
    },

    create: function (item) {
        strArray1 = this.cleanDecription(descSource);

        // string width
        var num1 = 0;


        const tmp = document.createElement('canvas');
        //const width = tmp.width = 480;
        //const height = tmp.height = 410;
        const ctx = tmp.getContext('2d');


        for (var line in strArray1) {
            console.log(strArray1[line]);
            ctx.font = "bold 1.5em AvQuest";
            size = ctx.measureText(strArray1[line].text);
            if(size.width > num1)
                num1 = size.width;
        }
        
        if(num1 < 100)
            num1 = 100;
            
        num2 = 16;//parseInt(ctx.font);
        
        console.log("Width:", num1);
        
        var image = new Image();
        image.src = "data:image/png;base64, " + imageSource; //item.image;
        
        image.onload = function() {
            var X, Y, Top, Left = 0
        
            if (image.height < 30) {
                Y = 1;
                Top = 32;
            } else if (image.height < 65) {
                Y = 2;
                Top = 61;
            } else if (image.height < 95) {
                Y = 3;
                Top = 90;
            } else {
                Y = 4;
                Top = 119;
            }
            
            if (image.width < 37) {
                X = 1;
                Left = 213; // 212 originally
            } else {
                X = 2;
                Left = 226;
            }
            
            const canvas = document.createElement('canvas');
            canvas.width = num1 + 14;
            canvas.height = num2 * strArray1.length + Top + 1;
            $("#itemList").append(canvas);
            const graphics = canvas.getContext('2d');
            
            
            console.log(itemScreenshot.bgnd);

            var bitmap2 = new Image();
            bitmap2.src = "data:image/png;base64, " + itemScreenshot.bgnd[Y-1];
            
            var hand = new Image();
            hand.src = "data:image/png;base64, ";            
            
            bitmap2.onload = function() {
                console.log("Drawing background");
                graphics.drawImage(bitmap2, canvas.width / 2 - Left, -9); // top -10 originally
                console.log("Drawing item-active background");
                graphics.fillStyle = "rgba(0, 128, 0, 0.2)";
                graphics.fillRect((canvas.width - image.width) / 2, 5, image.width, image.height);
                console.log("Drawing item");
                graphics.drawImage(image, (canvas.width - image.width) / 2, 5);
                console.log("Drawing text");
                // Todo: colors may change within a single line!
                for (var index in strArray1) {
                    pos = {
                        x: canvas.width / 2,
                        y: (index * num2 + Top + num2 - 3.0) // -1 originally
                    };
                    graphics.fillStyle = strArray1[index].color;
                    graphics.font = ctx.font;
                    graphics.filter = "blur(0.1px)";
                    graphics.textAlign = "center";
                    graphics.fillText((ctx.font.includes("Exocet") ? strArray1[index].text.toUpperCase() : strArray1[index].text), pos.x, pos.y);
                }
                console.log("Drawing cursor");
                graphics.drawImage(hand, (canvas.width + image.width) / 2 - 10, 5 + 10);
                        }
        }
                
                
    }
}